# HC method for SSS
using HomotopyContinuation
# Set parameters for ODEs
Kₒ, Kₙₜ, Kd, a₁, d, aₙₜ, aₒ, αₜ, αₒ, αₙ, δ, β, m1, m2, m3= 0.3, 0.2, 0.1, 1, 1, 1000, 1000, 1.0, 1.0, 1.0, 1, 0., 0., 0.05, 0.
# declare the variables
@polyvar N T NT NT2 D₀₀ᴼ D₁₀ᴼ D₀₁ᴼ D₁₁ᴼ O D₀₀ᵀ D₁₀ᵀ D₀₁ᵀ D₁₁ᵀ D₀ᴺ D₁ᴺ

# ----------  Define system of 15 polynomials in 15 variables
fN = -N*δ + αₙ*D₁ᴺ - N*T*a₁ + NT*Kd*a₁ + m1
fT = -T*δ + αₜ*D₁₁ᵀ - N*T*a₁ + NT*Kd*a₁ + m2
fNT = -NT*β - d*NT^2 + 2*d*NT2 + N*T*a₁ - NT*Kd*a₁
fNT2 = (1/2)*d*NT^2 - d*NT2 - β*NT2 - NT2*aₙₜ*D₀₀ᴼ - NT2*aₙₜ*D₀₀ᵀ - NT2*aₙₜ*D₀₁ᴼ - NT2*aₙₜ*D₀₁ᵀ + aₙₜ*Kₙₜ*D₁₀ᴼ + aₙₜ*Kₙₜ*D₁₀ᵀ + aₙₜ*Kₙₜ*D₁₁ᴼ + aₙₜ*Kₙₜ*D₁₁ᵀ
fD₀₀ᴼ = Kₒ*aₒ*D₀₁ᴼ - NT2*aₙₜ*D₀₀ᴼ - O*aₒ*D₀₀ᴼ + aₙₜ*Kₙₜ*D₁₀ᴼ
fD₁₀ᴼ = Kₒ*aₒ*D₁₁ᴼ + NT2*aₙₜ*D₀₀ᴼ - O*aₒ*D₁₀ᴼ - aₙₜ*Kₙₜ*D₁₀ᴼ
fD₀₁ᴼ = -Kₒ*aₒ*D₀₁ᴼ - NT2*aₙₜ*D₀₁ᴼ + O*aₒ*D₀₀ᴼ + aₙₜ*Kₙₜ*D₁₁ᴼ
fD₁₁ᴼ = -Kₒ*aₒ*D₁₁ᴼ + NT2*aₙₜ*D₀₁ᴼ + O*aₒ*D₁₀ᴼ - aₙₜ*Kₙₜ*D₁₁ᴼ
fO = -O*δ + αₒ*D₁₁ᴼ + Kₒ*aₒ*D₀₁ᴼ + Kₒ*aₒ*D₀₁ᵀ + Kₒ*aₒ*D₁ᴺ + Kₒ*aₒ*D₁₁ᴼ + Kₒ*aₒ*D₁₁ᵀ - O*aₒ*D₀ᴺ - O*aₒ*D₀₀ᴼ - O*aₒ*D₀₀ᵀ - O*aₒ*D₁₀ᴼ - O*aₒ*D₁₀ᵀ + m3
fD₀₀ᵀ = Kₒ*aₒ*D₀₁ᵀ - NT2*aₙₜ*D₀₀ᵀ - O*aₒ*D₀₀ᵀ + aₙₜ*Kₙₜ*D₁₀ᵀ
fD₁₀ᵀ = Kₒ*aₒ*D₁₁ᵀ + NT2*aₙₜ*D₀₀ᵀ - O*aₒ*D₁₀ᵀ - aₙₜ*Kₙₜ*D₁₀ᵀ
fD₀₁ᵀ = -Kₒ*aₒ*D₀₁ᵀ - NT2*aₙₜ*D₀₁ᵀ + O*aₒ*D₀₀ᵀ + aₙₜ*Kₙₜ*D₁₁ᵀ
fD₁₁ᵀ = -Kₒ*aₒ*D₁₁ᵀ + NT2*aₙₜ*D₀₁ᵀ + O*aₒ*D₁₀ᵀ - aₙₜ*Kₙₜ*D₁₁ᵀ
fD₀ᴺ = Kₒ*aₒ*D₁ᴺ - O*aₒ*D₀ᴺ
fD₁ᴺ = -Kₒ*aₒ*D₁ᴺ + O*aₒ*D₀ᴺ


f = [ fN, fT, fNT, fNT2, fD₀₀ᴼ, fD₁₀ᴼ, fD₀₁ᴼ, fD₁₁ᴼ, fO, fD₀₀ᵀ, fD₁₀ᵀ, fD₀₁ᵀ, fD₁₁ᵀ, fD₀ᴺ, fD₁ᴺ]
result = solve(f)
@show realsolutions(result)



# ======== For reduced system in 3D
# --------------  HC G-metric distance vs Parameterized HC ---------------
using HomotopyContinuation
# Set parameters for ODEs
Kₒ, Kₙₜ, Kd, a₁, d, aₙₜ, aₒ, αₜ, αₒ, αₙ, δ, β, m1, m2, m3= 0.3, 0.2, 0.1, 1., 1., 1000., 1000., 1.0, 1.0, 1.0, 1., 1e-6, 1e-6, 0.05, 1e-6
# declare the variables
@polyvar N T O

fN = -Kd*a₁*(d + β)*(Kd*a₁ + β - ((Kd^2*a₁^2*d + Kd^2*a₁^2*β + 2*Kd*a₁*d*β + 2*Kd*a₁*β^2 + 4*N*T*a₁*d*β + d*β^2 + β^3)/(d + β))^0.5)/(2*d*β) - N*T*a₁ - N*δ + O*αₙ/(Kₒ + O) + m1

fT = (-Kd*Kₒ*Kₙₜ*a₁*(d + β)*(Kd*a₁ + β - ((Kd^2*a₁^2*d + Kd^2*a₁^2*β + 2*Kd*a₁*d*β + 2*Kd*a₁*β^2 + 4*N*T*a₁*d*β + d*β^2 + β^3)/(d + β))^0.5)/(2*d*β) - Kd*Kₒ*a₁*(d + β)^2*(Kd*a₁ + β - ((Kd^2*a₁^2*d + Kd^2*a₁^2*β + 2*Kd*a₁*d*β + 2*Kd*a₁*β^2 + 4*N*T*a₁*d*β + d*β^2 + β^3)/(d + β))^0.5)^3/(16*d^2*β^3) - Kd*Kₙₜ*O*a₁*(d + β)*(Kd*a₁ + β - ((Kd^2*a₁^2*d + Kd^2*a₁^2*β + 2*Kd*a₁*d*β + 2*Kd*a₁*β^2 + 4*N*T*a₁*d*β + d*β^2 + β^3)/(d + β))^0.5)/(2*d*β) - Kd*O*a₁*(d + β)^2*(Kd*a₁ + β - ((Kd^2*a₁^2*d + Kd^2*a₁^2*β + 2*Kd*a₁*d*β + 2*Kd*a₁*β^2 + 4*N*T*a₁*d*β + d*β^2 + β^3)/(d + β))^0.5)^3/(16*d^2*β^3) - Kₒ*Kₙₜ*N*T*a₁ - Kₒ*Kₙₜ*T*δ + Kₒ*Kₙₜ*m2 - Kₒ*N*T*a₁*(d + β)*(Kd*a₁ + β - ((Kd^2*a₁^2*d + Kd^2*a₁^2*β + 2*Kd*a₁*d*β + 2*Kd*a₁*β^2 + 4*N*T*a₁*d*β + d*β^2 + β^3)/(d + β))^0.5)^2/(8*d*β^2) - Kₒ*T*δ*(d + β)*(Kd*a₁ + β - ((Kd^2*a₁^2*d + Kd^2*a₁^2*β + 2*Kd*a₁*d*β + 2*Kd*a₁*β^2 + 4*N*T*a₁*d*β + d*β^2 + β^3)/(d + β))^0.5)^2/(8*d*β^2) + Kₒ*m2*(d + β)*(Kd*a₁ + β - ((Kd^2*a₁^2*d + Kd^2*a₁^2*β + 2*Kd*a₁*d*β + 2*Kd*a₁*β^2 + 4*N*T*a₁*d*β + d*β^2 + β^3)/(d + β))^0.5)^2/(8*d*β^2) - Kₙₜ*N*O*T*a₁ - Kₙₜ*O*T*δ + Kₙₜ*O*m2 - N*O*T*a₁*(d + β)*(Kd*a₁ + β - ((Kd^2*a₁^2*d + Kd^2*a₁^2*β + 2*Kd*a₁*d*β + 2*Kd*a₁*β^2 + 4*N*T*a₁*d*β + d*β^2 + β^3)/(d + β))^0.5)^2/(8*d*β^2) - O*T*δ*(d + β)*(Kd*a₁ + β - ((Kd^2*a₁^2*d + Kd^2*a₁^2*β + 2*Kd*a₁*d*β + 2*Kd*a₁*β^2 + 4*N*T*a₁*d*β + d*β^2 + β^3)/(d + β))^0.5)^2/(8*d*β^2) + O*m2*(d + β)*(Kd*a₁ + β - ((Kd^2*a₁^2*d + Kd^2*a₁^2*β + 2*Kd*a₁*d*β + 2*Kd*a₁*β^2 + 4*N*T*a₁*d*β + d*β^2 + β^3)/(d + β))^0.5)^2/(8*d*β^2) + O*αₜ*(d + β)*(Kd*a₁ + β - ((Kd^2*a₁^2*d + Kd^2*a₁^2*β + 2*Kd*a₁*d*β + 2*Kd*a₁*β^2 + 4*N*T*a₁*d*β + d*β^2 + β^3)/(d + β))^0.5)^2/(8*d*β^2))/((Kₒ + O)*(Kₙₜ + (d + β)*(Kd*a₁ + β - ((Kd^2*a₁^2*d + Kd^2*a₁^2*β + 2*Kd*a₁*d*β + 2*Kd*a₁*β^2 + 4*N*T*a₁*d*β + d*β^2 + β^3)/(d + β))^0.5)^2/(8*d*β^2)))

fO = (-Kₒ*Kₙₜ*O*δ + Kₒ*Kₙₜ*m3 - Kₒ*O*δ*(d + β)*(Kd*a₁ + β - ((Kd^2*a₁^2*d + Kd^2*a₁^2*β + 2*Kd*a₁*d*β + 2*Kd*a₁*β^2 + 4*N*T*a₁*d*β + d*β^2 + β^3)/(d + β))^0.5)^2/(8*d*β^2) + Kₒ*m3*(d + β)*(Kd*a₁ + β - ((Kd^2*a₁^2*d + Kd^2*a₁^2*β + 2*Kd*a₁*d*β + 2*Kd*a₁*β^2 + 4*N*T*a₁*d*β + d*β^2 + β^3)/(d + β))^0.5)^2/(8*d*β^2) - Kₙₜ*O^2*δ + Kₙₜ*O*m3 - O^2*δ*(d + β)*(Kd*a₁ + β - ((Kd^2*a₁^2*d + Kd^2*a₁^2*β + 2*Kd*a₁*d*β + 2*Kd*a₁*β^2 + 4*N*T*a₁*d*β + d*β^2 + β^3)/(d + β))^0.5)^2/(8*d*β^2) + O*m3*(d + β)*(Kd*a₁ + β - ((Kd^2*a₁^2*d + Kd^2*a₁^2*β + 2*Kd*a₁*d*β + 2*Kd*a₁*β^2 + 4*N*T*a₁*d*β + d*β^2 + β^3)/(d + β))^0.5)^2/(8*d*β^2) + O*αₒ*(d + β)*(Kd*a₁ + β - ((Kd^2*a₁^2*d + Kd^2*a₁^2*β + 2*Kd*a₁*d*β + 2*Kd*a₁*β^2 + 4*N*T*a₁*d*β + d*β^2 + β^3)/(d + β))^0.5)^2/(8*d*β^2))/((Kₒ + O)*(Kₙₜ + (d + β)*(Kd*a₁ + β - ((Kd^2*a₁^2*d + Kd^2*a₁^2*β + 2*Kd*a₁*d*β + 2*Kd*a₁*β^2 + 4*N*T*a₁*d*β + d*β^2 + β^3)/(d + β))^0.5)^2/(8*d*β^2)))
f = [ fN, fT,  fO, ]
result = solve(f)
@show realsolutions(result)





# ======== For reduced system in 3D  for num only
